      SELECT ALL ( + col0 ) + - col1 FROM tab0 (FORMAT parquet) WHERE 29 NOT BETWEEN + col0 * + CAST ( NULL AS INTEGER ) + + 46 AND ( + 14 * - col0 ) OR ( 94 ) IN ( 52 );
  - name: tab0

outputs:
  - name: q13362.out
    data: |
      -66
      66
      96
